import React from 'react';
import { animated, useSpring } from '@react-spring/web';

interface BirdProps {
  position: number;
  velocity: number;
}

const Bird: React.FC<BirdProps> = ({ position, velocity }) => {
  const spring = useSpring({
    from: { transform: 'translateY(0px) rotate(0deg)' },
    to: { 
      transform: `translateY(${position}px) rotate(${Math.min(Math.max(velocity * 5, -30), 90)}deg)`
    },
    config: { tension: 300 }
  });

  return (
    <animated.div
      style={{
        ...spring,
        width: '40px',
        height: '40px',
        position: 'absolute',
        left: '50px',
        zIndex: 2,
      }}
    >
      <div style={{
        position: 'relative',
        width: '100%',
        height: '100%',
      }}>
        {/* Body */}
        <div style={{
          position: 'absolute',
          width: '30px',
          height: '20px',
          backgroundColor: '#1E90FF',
          borderRadius: '50%',
          top: '10px',
          left: '5px',
        }} />
        {/* Head */}
        <div style={{
          position: 'absolute',
          width: '16px',
          height: '16px',
          backgroundColor: '#4169E1',
          borderRadius: '50%',
          top: '6px',
          left: '20px',
        }} />
        {/* Wing */}
        <div style={{
          position: 'absolute',
          width: '15px',
          height: '12px',
          backgroundColor: '#4169E1',
          borderRadius: '50% 50% 0 50%',
          transform: 'rotate(-20deg)',
          top: '12px',
          left: '8px',
        }} />
        {/* Tail */}
        <div style={{
          position: 'absolute',
          width: '12px',
          height: '8px',
          backgroundColor: '#4169E1',
          borderRadius: '0 50% 0 50%',
          transform: 'rotate(15deg)',
          top: '15px',
          left: '2px',
        }} />
      </div>
    </animated.div>
  );
};

export default Bird;
